V8:
Əhmədli metrosundan iki dəqiqəlik məsafədə, Bakı restoranı ilə üzbəüzdür. McDonald's və Coffeemania binadan bir dəqiqəlik məsafədə yerləşir.
9 mərtəbəli Kiyev layihəli binanın 5-ci mərtəbəsində, sahəsi 65 kv.m. olan ideal təmirli 3 otaqlı mənzil satılır. 
- Blokda əlavə geniş saxlanc yeri (“кладовка”) var;
- Sənədləri qaydasındadır, çıxarış (“kupça”) var;
- Su, işıq, qaz, lift daimidir;
- Otaqların qapıları keyfiyyətli yerli meşə materialından sifarişlə yığılmış möhkəm taxta qapılardır;
- Mənzilin Türkiyə istehsalı olan seyf qapısı, plastik pəncərələri var;
- Sanitar qovşaq (WC) ayrıdır, əla təmirlidir. Ehtiyat su çəni var;
- Binanın ümumi istilik sistemindən əlavə, mənzildə kombi istilik sistemi də var;
- Mənzil orta blokda yerləşir, yelçəkəndir (“skvaznoydur”). Pəncərələr məhəllə və küçə tərəfdən yola baxır, qarşısında bina tikilmə ehtimalı yoxdur;
- Balkonda və koridorda çox geniş və möhkəm şkaflar yığılıb;
- Mətbəx genişdir və mebeli keyfiyyətli materialdan yığılıb;
- Bütün oboylar İtaliya istehsalıdır;
- Santexnik və elektrik sistemi keyfiyyətli işlənmişdir;
- Uşaqlı ailələr üçün xüsusən əlverişlidir. Evdə siqaret çəkilməyib;
- Mənzil məktəbə, uşaq bağçasına, marketlərə,ümumiyyətlə bütün infrastrukturlara çox yaxındır;
- Tam şəraitli və yaşayış üçün çox əla mənzildir;
- Artıq dərəcədə xahiş edirəm, satış agentləri (maklerlər) narahat etməsin.
